import React from "react";
import { Link, useNavigate } from "react-router-dom";

function Toolbar() {
  return (
    <div className="toolbar">
      <Link to="/shop">Shop</Link>
      <Link to="/main">Back</Link>
      <Link to="/arena">Arena</Link>
    </div>
  );
}

export default Toolbar;
